DROP TABLE IF EXISTS `processes`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `processes` (
  `processes_id` int(11) NOT NULL DEFAULT '0',
  `processes_desc` varchar(200) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Description of the process',
  `processes_comment` text COLLATE utf8_unicode_ci NOT NULL,
  `processes_due_duration` bigint(20) NOT NULL DEFAULT '0',
  `processes_expiry_duration` bigint(10) NOT NULL DEFAULT '0',
  `desc_fields` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'link to template_field_info - displays to user what record this is',
  `write_current_user_to_db` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `post_process_field` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `currentFlow_next_process_ref` int(11) NOT NULL DEFAULT '0' COMMENT 'processes_id of process to go to after this process has completed',
  `currentFlow_settings_key` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 's_key in settings table referencing who will receive the next process',
  `currentFlow_message` text COLLATE utf8_unicode_ci COMMENT 'Text that is included in an automated email that is sent when the process moves to the next one',
  `currentFlow_skip_test` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `spawnUser_next_process_ref` int(11) NOT NULL DEFAULT '0' COMMENT 'processes_id of process to go to after this process has completed. Process also goes to a different user',
  `spawnUser_settings_key` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 's_key in settings table referencing who will receive the next process',
  `spawnUser_message` text COLLATE utf8_unicode_ci COMMENT 'Email message for next user',
  `spawnUser_activeDate` text COLLATE utf8_unicode_ci,
  `may_go_previous` enum('yes','no') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'no',
  `keep_workflow_settings` enum('yes','no','temp') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'yes' COMMENT 'If yes -> copies workflow_settings in active_processes table to each new active process for all work_flows in this process (Good for editing forms for a specific programme). If temp or no -> clears workflow_settings as you move between work_flows',
  `menu_is_item` enum('Yes','No') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'No' COMMENT 'Yes->Appears in menu, No->Is not a menuitem',
  `menu_perant` int(10) NOT NULL DEFAULT '0' COMMENT 'Specifies the menu this process must be in (processes_id (usually negative of the parent process))',
  `menu_alt_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Name that will appear in the menu',
  `menu_in_menu` varchar(20) COLLATE utf8_unicode_ci NOT NULL DEFAULT 'main',
  `on_item_click` enum('href','none','showDescription') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'href',
  `menu_sequence_number` bigint(4) NOT NULL DEFAULT '100',
  `proscess_supervisor` varchar(250) COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
  `audit_level` int(11) NOT NULL DEFAULT '0' COMMENT 'log to the workflow_audit_trail table if less than a value set in the configuration file',
  PRIMARY KEY (`processes_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci PACK_KEYS=0;
