INSERT INTO `processes` VALUES (-3,'Reports','',0,0,'','',NULL,2,NULL,NULL,'',0,NULL,NULL,NULL,'no','no','Yes',0,'','main','href',100,'0',0),(-2,'Admin','',0,0,'','',NULL,2,'','','',0,'',NULL,NULL,'no','no','Yes',0,'','main','none',200,'0',8500),(1,'Welcome Page','',0,0,'','',NULL,2,'','','',0,'','','','no','no','Yes',0,'Log out','main','href',999,'0',0),(2,'Home','',0,0,'','',NULL,2,'','','',0,'','',NULL,'no','no','Yes',0,'','main','href',100,'0',0),(3,'General Help','<div class=\"help\">\r\n	<p>The National Reviews Online system supports the process of programme re-accreditation as per the Framework for the National Review of Programmes.</p>\r\n	<div class=\"helpSection\">\r\n		<h3>The top right navigation:</h3>\r\n		<ul>\r\n			<li>\r\n				<strong>HOME: </strong>Takes you back to the Home page with a list of your reviews and links to relevant documentation.\r\n			</li>\r\n			<li>\r\n				<strong>REPORTS: </strong>Gives you access to reports\r\n			</li>\r\n			<li>\r\n				<strong>HELP: </strong>Gives you access to this general help page as well as a system manual.\r\n			</li>\r\n			<li>\r\n				<strong>MY ACCOUNT: </strong>Allows you edit your user profile information.\r\n			</li>\r\n			<li>\r\n				<strong>LOGOUT: </strong>Logs you out of the system.\r\n			</li>\r\n		</ul>\r\n	</div>\r\n	\r\n	<div class=\"helpSection\">\r\n		<h3>HOME PAGE:</h3>\r\n		<ul>\r\n			<li>\r\n				<strong>Inbox - Processes to attend to: </strong>Lists the national review activities for your institution\r\n				<ul>\r\n					<li>\r\n						<strong>Self-evaluation reports</strong>\r\n						<ul>\r\n							<li>\r\n								<strong>Action: </strong>Continue button for starting the process of submitting your SER\r\n							</li>\r\n						</ul>\r\n					</li>\r\n				</ul>\r\n			</li>\r\n			<li>\r\n				<strong>REPORTS: </strong>Gives you access to reports\r\n			</li>\r\n		</ul>\r\n	</div>\r\n	\r\n	<div class=\"helpSection\">\r\n		<h3>The white left top panel:</h3>\r\n		<p>This panel contains action buttons for each page.</p>\r\n		<ul>\r\n			<li>\r\n				<strong>SAVE: </strong>Saves the information on the current page\r\n			</li>\r\n			<li>\r\n				<strong>PRINT: </strong>Opens a print-friendly view of the current page\r\n			</li>\r\n			<li>\r\n				<strong>PREVIEW: </strong>Shows a preview of all the information you will be submitting\r\n			</li>\r\n			<li>\r\n				<strong>PREVIOUS: </strong>Takes you to the previous page\r\n			</li>\r\n			<li>\r\n				<strong>NEXT: </strong>Takes you to the next page\r\n			</li>\r\n			<li>\r\n				<strong>SUBMIT TO CHE: </strong>Once all is completed, this red button will appear to submit all required information to the CHE.\r\n			</li>\r\n			<li>\r\n				<strong>SEARCH: </strong>Opens the search fields to filter through the report view\r\n			</li>\r\n		</ul>\r\n	</div>\r\n	\r\n	<div class=\"helpSection\">\r\n		<h3>The yellow left side navigation:</h3>\r\n		<p>This side menu helps you navigate through all the different sections that have to be completed before submission.</p>\r\n		<ul>\r\n			<li>\r\n				<strong>SER STEPS TO FOLLOW: </strong>Overview of information you need to submit and an indication of your progress.\r\n			</li>\r\n			<li>\r\n				<strong>4.1 PROFILE OF PROGRAMME UNDER REVIEW: </strong>Baseline data that you must provide by completing the tables indicated.\r\n			</li>\r\n			<li>\r\n				<strong>4.5 BUDGET: </strong>Baseline data that you must provide by completing the tables indicated.\r\n			</li>\r\n			<li>\r\n				<strong>4.6 ACADEMIC STAFF: </strong>Baseline data that you must provide by completing the tables indicated.\r\n			</li>\r\n			<li>\r\n				<strong>4.7 STUDENT RATE OF COMPLETION: </strong>Baseline data that you must provide by completing the tables indicated.\r\n			</li>\r\n			<li>\r\n				<strong>SELF-EVALUATION AGAINST CRITERIA: </strong>Performance rating per criterion that you must provide.\r\n			</li>\r\n			<li>\r\n				<strong>VALIDATION: </strong>Shows the completeness of the information you have provided.\r\n			</li>\r\n		</ul>\r\n	</div>\r\n</div>',0,0,'','',NULL,2,'','','',0,'','',NULL,'no','no','Yes',4,'General Help','main','showDescription',400,'0',0),(4,'Help menu','',0,0,'','',NULL,2,'','','',0,'','',NULL,'no','no','Yes',0,'Help','main','none',300,'0',0),(5,'Manage user groups','Add and edit security groups',0,0,'','',NULL,0,NULL,NULL,'',0,NULL,NULL,NULL,'no','temp','Yes',-2,'Manage user groups','main','href',200,'0',0),(6,'Manage users','',0,0,'','',NULL,2,NULL,NULL,'',0,NULL,NULL,NULL,'no','temp','Yes',-2,'Manage users','main','href',100,'0',0),(7,'My account','Account information',0,0,'','',NULL,7,NULL,NULL,'',0,NULL,NULL,NULL,'no','temp','Yes',0,NULL,'main','href',400,'0',0),(8,'SER','Data capture of the self-evaluation report, data tables and sign-off for a national review.',0,0,'nr_programme_name','',NULL,2,NULL,'An institution has submitted their Self-evaluation report for review.','',10,'usr_submissions','',NULL,'no','yes','No',0,NULL,'main','href',100,'0',0),(9,'Forgot Password','',0,0,'','',NULL,1,NULL,NULL,'',0,NULL,NULL,NULL,'no','yes','No',0,NULL,'main','href',100,'0',0),(10,'Screening','New submission of a SER report',0,0,'hei_name','',NULL,2,NULL,'Screening has been completed.','',15,'usr_prelim',NULL,NULL,'no','yes','No',0,NULL,'main','href',100,'0',0),(11,'Institution contacts','',0,0,'','',NULL,2,NULL,NULL,'',0,NULL,NULL,NULL,'no','temp','Yes',-3,'Institution contacts','main','href',150,'0',0),(12,'Change Password','',0,0,'','',NULL,2,NULL,NULL,'',0,NULL,NULL,NULL,'no','no','No',0,NULL,'main','href',100,'0',0),(13,'Institution progress report','',0,0,'','',NULL,2,NULL,NULL,'',0,NULL,NULL,NULL,'no','temp','Yes',-3,'Institution progress report','main','href',125,'0',0),(14,'Detailed progress report for download','',0,0,'','',NULL,2,NULL,NULL,'',0,NULL,NULL,NULL,'no','temp','Yes',-3,'Detailed progress report for download','main','href',100,'0',0),(15,'Manage desktop evaluation and panel members','Manage desktop evaluation and panel members',0,0,'he