EVALUATION REPORT PAGE:</h3>\n                To upload your report:\n                <ul>\n                        <li>\n                                Click on the blue link: <strong>Click here to select the file that you need to upload</strong>\n                        </li>\n                        <li>\n                                Click the <strong>Choose File</strong> button\n                        </li>\n                        <li>\n                                Click the <strong>Upload</strong> button\n                        </li>\n                        <li>\n                                Wait for the upload to complete\n                        </li>\n                </ul>\n        </div>\n\n        <div class=\"helpSection\">\n                <h3>THE WHITE LEFT TOP PANEL:</h3>\n                To upload your report:\n                <ul>\n                        <li>\n                                <strong>PREVIOUS: </strong>Takes you to the previous page\n                        </li>\n                        <li>\n                                <strong>SAVE: </strong>Saves the information on the current page\n                        </li>\n                        <li>\n                                <strong>SEARCH: </strong>Opens the search fields to filter through the report view\n                        </li>\n                </ul>\n        </div>\n\n        <div class=\"helpSection\">\n                <h3>THE YELLOW QUICKLINKS ON THE LEFT:</h3>\n                <p>This Quicklinks box on the left gives you quick access to the documents and templates that were available to the institutions prior to submitting their SER\'s.</p>\n        </div>\n</div>',0,0,'','',NULL,2,'','','',0,'','',NULL,'no','no','Yes',4,'Desktop Evaluators Help','main','showDescription',500,'0',0),(18,'Upload chair report','Upload chair report',0,0,'hei_name','',NULL,2,NULL,NULL,'',0,'',NULL,NULL,'no','temp','No',18,NULL,'main','href',100,'0',0),(19,'Panel member vie