CREATE TABLE `template_field` (
  `template_field_id` int(11) NOT NULL AUTO_INCREMENT,
  `template_name` varchar(40) COLLATE utf8_unicode_ci NOT NULL COMMENT 'reference to template in work_flows table',
  `fieldName` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fieldType` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fieldOrder` int(11) NOT NULL DEFAULT '0',
  `fieldTitle` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `fieldValue` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fieldValuesArray` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fieldClass` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fieldSize` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '15',
  `fieldMaxFieldSize` varchar(255) COLLATE utf8_unicode_ci DEFAULT '25',
  `fieldCols` varchar(255) COLLATE utf8_unicode_ci DEFAULT '70',
  `fieldRows` varchar(255) COLLATE utf8_unicode_ci DEFAULT '10',
  `fieldStyle` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fieldOnClick` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fieldOnChange` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fieldStatus` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fieldDBconnected` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '1 -> get field from a database 0->field is not connected to a database',
  `fieldNullValue` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fieldOptions` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fieldSelectName` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fieldSelectID` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fieldSelectTable` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fieldSelectWhere` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '1',
  `fieldMainTable` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fieldMainFld` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fieldMainVal` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fieldRelationFld` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fieldRelationTable` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fieldRelationKey` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fieldRelationVal` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fieldDisplayName` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
