INSERT INTO `template_text` VALUES (1,'ser_submit','SERReportComplete',1,'$prog_id = $this->dbTableInfoArray[\"nr_programmes\"]->dbTableCurrentID;','Dear NR-online user\r\n\r\nThank you for submitting your Self Evaluation Report (SER) to the CHE.\r\n\r\nThe National Reviews (NR) directorate will now screen your application for completeness. In the event that some information is incomplete the CHE will return the application to your institution for update and re-submission.\r\nPlease contact us if you have any queries. \r\n\r\nKind regards\r\nDirector: National Reviews \r\nCOUNCIL ON HIGHER EDUCATION\r\nTel: 012 349 3918\r\nEmail: nr-online@che.ac.za\r\n'),(2,'forgotPassword','PassReq',1,'// USERNAME & PASS is set in the forgotForm','Dear $USERNAME,\r\n\r\nPlease find below a new system generated password to log onto the Accreditation System.  Please note that you need to use your e-mail address as your username. \r\n\r\nPassword: $PASS\r\n\r\nSincerely,'),(3,'return_ser_to_institution','return_ser_to_institution_email',1,'$currentUserID = Settings::get(\'currentUserID\');	\r\n$prog_id = $this->dbTableInfoArray[\"nr_programmes\"]->dbTableCurrentID;\r\n	$adminArr = $this->getProgrammeAdministrator($prog_id);\r\n	$adminID = $adminArr[0];\r\n\r\n$USERNAME = $this->db->getValueFromTable(\"users\", \"user_id\", $adminID, \"name\");\r\n\r\n$currentUserName = $this->getUserFullName($currentUserID);\r\n\r\n$currentUserInfoArr = $this->db->customArrRequest(\"contact_nr, email\",\"users\",\"\",\"user_id= $currentUserID\");\r\n\r\n$currentUserContactNr = $currentUserInfoArr[\'contact_nr\'];\r\n$currentUserEmail = $currentUserInfoArr[\'email\'];','Dear $USERNAME,\r\n\r\nThe SER submitted has been screened for completeness and the CHE has identified areas that need further attention.\r\n \r\nKindly consult the attached checklist feedback document to complete your SER.\r\n\r\nPlease provide the requested information, ensure that the updated SER is uploaded and re-submit it to the CHE by (date within 3 working days).\r\n\r\nKind regards\r\n$currentUserName\r\n$currentUserContactNr\r\n$currentUserEmail\r\n\r\nNational Reviews Directorate\r\nThe Council on Higher Education (CHE)	\r\nTelephone: +27 (0)12 349 3918\r\nE-mail: nr-online@che.ac.za'),(4,'generic','colleagueRequest',0,'$prog_id = $this->dbTableInfoArray[\"nr_programmes\"]->dbTableCurrentID;\r\n$infoArr = $this->db->customArrRequest(\"nr_programme_name, hei_name, hei_code\",\"nr_programmes\",\"\",\"id = $prog_id\");\r\n\r\n$REF = $infoArr[\"hei_code\"];\r\n$INAME = $infoArr[\"hei_name\"];\r\n$PNAME = $infoArr[\"nr_programme_name\"];\r\n$REQUEST = readPost(\"send_to_colleague_request\");','Dear Colleague\r\n\r\nThe following process has been sent to you:\r\n\r\nInstitution: $INAME\r\nProgramme name: $PNAME\r\nReference number: $REF\r\n\r\nYour colleague requests that you assist with the following:\r\n\r\n$REQUEST\r\n\r\nPlease logon to the NR-online system and do the required processing.\r\n\r\nKind regards\r\n\r\nDirector: National Reviews \r\nCOUNCIL ON HIGHER EDUCATION\r\nTel: 012 349 3918\r\nEmail: nr-online@che.ac.za'),(5,'ser_submit_llb','SERReportCompleteLLB',1,'$prog_id = $this->dbTableInfoArray[\"nr_programmes\"]->dbTableCurrentID;','Dear NR-online user\r\n\r\nThank you for submitting your Self Evaluation Report (SER) to the CHE.\r\n\r\nThe National Reviews (NR) directorate will now screen your application for completeness. In the event that some information is incomplete the CHE will return the application to your institution for update and re-submission.\r\nPlease contact us if you have any queries. \r\n\r\nKind regards\r\nDirector: National Reviews \r\nCOUNCIL ON HIGHER EDUCATION\r\nTel: 012 349 3918\r\nEmail: nr-online@che.ac.za\r\n');
