--
-- Table structure for table `work_flows`
--

DROP TABLE IF EXISTS `work_flows`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `work_flows` (
  `work_flows_id` int(20) NOT NULL AUTO_INCREMENT,
  `processes_ref` int(11) NOT NULL DEFAULT '0' COMMENT 'foreign key to processes',
  `sec_no` int(11) NOT NULL DEFAULT '100' COMMENT 'NB NB Order that the work_flows will be executed in for a process.',
  `workFlowType_ref` int(11) NOT NULL DEFAULT '1' COMMENT 'Indicates how workflow must be processed. (linked to table workflowtype)',
  `command` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'workflowtype: 6 -> name of label; 7 -> name of label to jump to if condition is true; 3 -> name of label to jump to.',
  `condition` text COLLATE utf8_unicode_ci NOT NULL COMMENT 'if workflowtype = 7 then evaluate condition. If true jump to label specified in command.',
  `template` varchar(40) COLLATE utf8_unicode_ci NOT NULL COMMENT 'name of physical file in templates directory. required if workflowtype = 1',
  `taskName` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `validation` int(11) NOT NULL DEFAULT '0',
  `securityLevel` int(11) NOT NULL DEFAULT '1',
  `html_name` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'name of physical file in html directory. required if workflowtype = 1.',
  `template_dbTableName` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'name of data table this work_flow will operate on',
  `template_dbTableKeyField` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'name of primary key of table this work_flow will operate on',
  PRIMARY KEY (`work_flows_id`),
  KEY `sec_no` (`sec_no`),
  KEY `workFlowType_ref` (`workFlowType_ref`),
  KEY `fk_processes` (`processes_ref`),
  CONSTRAINT `work_flows_ibfk_1` FOREIGN KEY (`processes_ref`) REFERENCES `processes` (`processes_id`)
) ENGINE=InnoDB AUTO_INCREMENT=265 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
